// app.js
document.addEventListener("DOMContentLoaded", () => {
  const spinButton = document.getElementById("spinButton");
  const reels = [
      document.getElementById("reel1"),
      document.getElementById("reel2"),
      document.getElementById("reel3"),
  ];
  const balanceValueElement = document.getElementById("balanceValue");
  let balance = 1500;

  const images = [
      "https://avatars.mds.yandex.net/i?id=5231edc441787b816d165ffb4df4d022f5c1a645-5658514-images-thumbs&n=13",
      "https://avatars.mds.yandex.net/i?id=5d97bd9f3575a9aa349952e046cb04b521d7e3cb-10952687-images-thumbs&n=13",
      "https://avatars.mds.yandex.net/i?id=ca3c4165b948241bc099e8f4d7b3c9720b50069e-7132164-images-thumbs&n=13",
      "https://avatars.mds.yandex.net/i?id=bda2be0c1b32342551fb1f156adb93fd-5172966-images-thumbs&n=13",
      "https://avatars.mds.yandex.net/i?id=cacc99ba418f639f2caa2fb4063c77d03b0ac5062bdbef3e-12522259-images-thumbs&n=13",
      "https://avatars.mds.yandex.net/i?id=7038ae32e826b7adf7a17a0620eda2b02c525fe1-9067973-images-thumbs&n=13",
      "data:image/jpeg;base64,"
  ];

  function spinReels() {
      if (balance < 50) {
          showNotification("   !");
          return;
      }

      balance -= 50;
      updateBalanceDisplay();

      reels.forEach(reel => {
          const randomIndex = Math.floor(Math.random() * images.length);
          reel.style.backgroundImage = `url(${images[randomIndex]})`;
      });

      // ,     
      const firstImage = reels[0].style.backgroundImage;
      if (reels.every(reel => reel.style.backgroundImage === firstImage)) {
          balance += 1000;
          updateBalanceDisplay();
          showNotification("!   1000!");
      }
  }

  function updateBalanceDisplay() {
      balanceValueElement.textContent = balance;
  }

  function showNotification(message) {
      const notification = document.createElement("div");
      notification.className = "notification";
      notification.textContent = message;
      document.body.appendChild(notification);
      setTimeout(() => {
          notification.remove();
      }, 3000);
  }

  spinButton.addEventListener("click", spinReels);
});